SELECT (CASE WHEN ("Eixo_1"."no_dependencia_admin" = 'Privada') THEN "Eixo_1"."mantenedora" ELSE "Eixo_1"."instituicao" END) AS "Calculation_838513978982854656",   "Eixo_1"."municipio_do_local_da_oferta" AS "municipio_do_local_da_oferta",   "Eixo_1"."no_dependencia_admin" AS "no_dependencia_admin",   "Eixo_1"."nome_curso_catalogo_guia" AS "nome_curso_catalogo_guia",   "Eixo_1"."nome_da_ue" AS "nome_da_ue",   SUM(CAST("Eixo_1"."Number of Records" AS BIGINT)) AS "sum:Number of Records:ok",   "Eixo_1"."uf_do_local_da_oferta" AS "uf_do_local_da_oferta",   CAST(EXTRACT(YEAR FROM "Eixo_1"."data_de_inicio") AS BIGINT) AS "yr:data_de_inicio:ok" FROM "Eixo_1" WHERE (("Eixo_1"."uf_do_local_da_oferta" = 'PE') AND (NOT (("Eixo_1"."nome da sit matricula (situacao detalhada)" NOT IN ('', 'TRANSF_EXT', 'INTEGRALIZADA', 'FREQ_INIC_INSUF', 'TRANCADA', 'CONCLUÍDA', 'TRANSF_INT', 'EM_CURSO', 'REPROVADA', 'ABANDONO', 'CONFIRMADA', 'EM_DEPENDÊNCIA')) OR ("Eixo_1"."nome da sit matricula (situacao detalhada)" IS NULL))) AND (NOT ("Eixo_1"."situacao_da_turma" IN ('CANCELADA', 'CRIADA', 'PUBLICADA')))) GROUP BY "Calculation_838513978982854656",   "municipio_do_local_da_oferta",   "no_dependencia_admin",   "nome_curso_catalogo_guia",   "nome_da_ue",   "uf_do_local_da_oferta",   "yr:data_de_inicio:ok" ORDER BY "Calculation_838513978982854656";
